import styled from "styled-components";
import Outside from "./component/Outside.jsx";
import InsideDust from "./component/InsideDust.jsx";
import "./App.css";
import { DUMMY_DATA } from "./data.js";


const Wrapper = styled.div`
  font-style: normal;
  //background: linear-gradient(${(props) => props.boxColor}, white);
  padding: 0;

`;

function App() {
  const Dustset = 48;
  let selectDust = "";

  if (Dustset >= 0 && Dustset <= 30) {
    selectDust = "good";
  } else if (Dustset > 30 && Dustset <= 80) {
    selectDust = "average";
  } else if (Dustset > 80 && Dustset <= 150) {
    selectDust = "bad";
  } else if (Dustset > 150) {
    selectDust = "very_bad";
  }

  return (
    <>
      <Wrapper boxColor={DUMMY_DATA[selectDust].color}>
        <InsideDust Dust={selectDust} DustRate={Dustset}></InsideDust>
        <Outside></Outside>
      </Wrapper>
    </>
  );
}

export default App;
